    <script>
        $(document).ready(function() {
            // Initialize Select2
            $('#projectSelect').select2();

            // Update credentials when a project is selected
            $('#projectSelect').on('change', function() {
                const selectedValue = $(this).val();
                if (selectedValue) {
                    const [key, token] = selectedValue.split("|");
                    $('#key').val(key);
                    $('#token').val(token);
                } else {
                    $('#key').val('');
                    $('#token').val('');
                }
            });
        });
    </script>
